 <>
  <h1>{`${fname}lname`} Netflix Pick</h1>
  <p>Here are my top {Math.ceil(Math.random()*10)} Netflix TV Series......</p>
  <ol>
  <li>Mirzapur</li>
  <li>Secret Game</li>
  <li>Paatal Lok</li>
  <li>Money Hiest</li>
  <li>Harry Porter</li>
  </ol>
  </>,
document.getElementById('root')
);
